&lt;p&gt;
	As a result of technological breakthroughs, research and applications in the Terahertz (THz) radiation system are experiencing explosive growth. The non-ionizing and penetrative nature of THz radiation makes it promising for detection in the medical imaging applications. The THz image can be identified as markers of malignant tissues.&lt;/p&gt;
&lt;p&gt;
	Because the requirements for THz instruments are very ambitious, there is a need for new nano-antenna configurations, and for refining existing configurations and technologies for top performance. In this study, we will investigate various THz nano-antennas to improve the performance of the nano-antenna with innovative designs. The objective of this study is to highlight current and emerging research in the THz nano-antenna fields, as well as applications of this technology.&lt;/p&gt;
